import { Component, Input } from '@angular/core';
import { Meta, moduleMetadata, StoryObj } from '@storybook/angular';
import { action } from '@storybook/addon-actions';
import { tap } from 'rxjs/operators';
import { MatButtonModule } from '@angular/material/button';
import { MatDialogModule, MatDialog } from '@angular/material/dialog';

import { GioConnectorDialogComponent, GioConnectorDialogData } from './gio-connector-dialog.component';
import { GioConnectorDialogModule } from './gio-connector-dialog.module';

import { PluginMoreInformation } from '../../../../entities/plugin/PluginMoreInformation';

@Component({
  selector: 'gio-connector-dialog-story',
  template: `<button id="open-dialog" (click)="openDialog()">More information</button>`,
})
class GioConnectorDialogStoryComponent {
  @Input() public name: string;
  @Input() public pluginMoreInformation: PluginMoreInformation;

  constructor(private readonly matDialog: MatDialog) {}

  public openDialog() {
    this.matDialog
      .open<GioConnectorDialogComponent, GioConnectorDialogData, boolean>(GioConnectorDialogComponent, {
        data: {
          name: this.name,
          pluginMoreInformation: this.pluginMoreInformation,
        },
        role: 'alertdialog',
        id: 'dialog',
      })
      .afterClosed()
      .pipe(
        tap((confirmed) => {
          action('confirmed?')(confirmed);
        }),
      )
      .subscribe();
  }
}

export default {
  title: 'Shared / Connector dialog',
  component: GioConnectorDialogComponent,
  decorators: [
    moduleMetadata({
      declarations: [GioConnectorDialogStoryComponent],
      imports: [GioConnectorDialogModule, MatButtonModule, MatDialogModule],
    }),
  ],
  argTypes: {
    name: {
      type: { name: 'string', value: '' },
    },
    pluginMoreInformation: {
      type: { name: 'object', value: {} },
    },
  },
  render: (args) => ({
    template: `<gio-connector-dialog-story [name]="name" [pluginMoreInformation]="pluginMoreInformation"></gio-connector-dialog-story>`,
    props: { ...args },
  }),
  parameters: {
    chromatic: { delay: 1000 },
  },
} as Meta;

export const Default: StoryObj = {
  play: (context) => {
    const button = context.canvasElement.querySelector('#open-dialog') as HTMLButtonElement;
    button.click();
  },
};

Default.args = {
  name: 'HTTP GET',
  pluginMoreInformation: {
    description:
      'Let your consumers send synchronous, on-demand requests for events via a standard HTTP GET requests. Use a standard HTTP proxy to mediate between client applications as data consumers and event brokers such as Kafka.',
    documentationUrl: 'https://www.gravitee.io/plugins/gravitee-entrypoint-http-get',
    schemaImg:
      'data:image/png;base64,',
  },
};
